gmplsTunnelARHopProtection = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 166, 13, 2, 3, 1, 6), Bits().subtype(namedValues=NamedValues(("localAvailable", 0), ("localInUse", 1), ))).setMaxAccess("readonly")
