gmplsTunnelErrorTLVs = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 166, 13, 2, 6, 1, 7), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 65535))).setMaxAccess("readonly")
